import React from 'react';
import { Link } from 'react-router-dom';

const Landing = () => {
  return (
    <section cl='landing'>
      <div cl='dark-overlay'>
        <div cl='landing-inner'>
          <h1 cl='x-large'>Developer Connector</h1>
          <p cl='lead'>
            Create a developer profile/portfolio, share posts and get help from
            other developers
          </p>
          <div cl='buttons'>
            <Link to='/register' cl='btn btn-primary'>
              Sign Up
            </Link>
            <Link to='/login' cl='btn btn-light'>
              Login
            </Link>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Landing;
